  if (!bgColor || typeof bgColor !== 'string') {
    return '#000000';
  }

  const hex = bgColor.startsWith('#') ? bgColor.slice(1) : bgColor;

  const r = Number.parseInt(hex.substring(0, 2), 16);
  const g = Number.parseInt(hex.substring(2, 4), 16);
